import React from 'react';

const ChooseArea = ({courses, setCourse, groups, setGroup, labs,setLab}) => {
    return (
        <div className={divOpts}>
            {courses.map((a) => <div key={a.id} className={"options"} onClick={() => setCourse(a)}>{a.name}</div>)}
            {groups.map((a) => <div key={a} className={"options"} onClick={(e) => {
                setGroup(a)}
            }>{a}</div>)}
            {labs.map((a) => <div key={a} className={"options"} onClick={(e) => {
                setLab(a)}
            }>{a}</div>)}

        </div>
    );
};

export default ChooseArea;
